import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Labs from './components/Labs';
import Login from "./components/Login";
import Register from "./components/Register";
import Main from "./components/Main";
import RegisterLab from "./components/RegisterLab";
import axios, { getAdapter } from 'axios';
import { useEffect, useState } from 'react';
import Cookies from 'js-cookie';
import Home from "./components/Home";
import Schedule from "./components/Schedule";
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  const [user,setUser] = useState('') 

  const getcsrf = async () => {
    const res = await axios.get('http://127.0.0.1:8000/api/users/csrf/')
    console.log('app :',res.data)
  }

  useEffect(()=> {
    getcsrf();
  },[])


  return (
    <div className="App">
  <Router>
    <Routes>

        <Route path='/' element = { <Navbar/>}>
        <Route path="/Login" element={<Login setUser = { setUser }/>}>
        </Route>
    </Route>
      <Route path='/' element = { <Navbar />}>
    <Route path="/Register" element={<Register/>}>
    </Route>
 </Route>




      <Route path="/" element={<ProtectedRoute><Main/></ProtectedRoute>}></Route>


          <Route path='/' element = { <Navbar user={user} setUser={setUser}/>}>
      <Route path="/Home" element={<Home/>}></Route>
      </Route>
   <Route path='/' element = { <Navbar user={user} setUser={setUser}/>}>
    <Route path="/Labs" element={<Labs/>}></Route>
  </Route>
 <Route path='/' element = { <Navbar user={user} setUser={setUser}/>}>
      <Route path="/RegisterLab" element={<RegisterLab/>}></Route>
      </Route>


       <Route path='/' element = { <Navbar user={user} setUser={setUser}/>}>
    <Route path="/Schedule" element={<Schedule user={user}/>} />

    </Route>
    </Routes>
  </Router>
    </div>
  );
}

export default App;
